import React from "react";
import "./App.css";
import styled from "styled-components";
import Title from "./component/Title";
import Button from "./component/Button";

const Container = styled.div`
  display:flex;
  flex-direction:column;
  justify-content:center;
  align-items:center;
  width:100%;
  height:100vh;
  background: #222;
`

function App() {
  return (
    <Container>
      <Title label="할 일 목록"/>
      <Button/>
    </Container>
  );
}

export default App;
